import React from 'react'
import InputWrapper from './InputWrapper'
import Button from '../Button'

function SignIn(props){
    function setEmail(event){
        setLoginDetails(prevState=>{
            prevState.email=event.target.value
        })
    }
    function setPassword(event){
        setLoginDetails(prevState=>{
            prevState.password=event.target.value
        })
    }
    return(
        <div className="top-nav">  
            <div className="top-nav-margin"> 
                <div className="top-nav-left">
                    <h1>Friend Finder</h1>
                </div>
                <div className="top-nav-right">
                    <InputWrapper method={props.handleEmail} class="header-input" text="Email or Phone" type="text"/>
                    <InputWrapper method={props.handlePassword} class="header-input" text="Password" type="password"/>
                    <Button class="ff-button" name="Log In"/>
                </div>
            </div>
        </div>      
    );
}

export default SignIn
